import React, { Component } from "react";
import Card from "./../Card/CardPresentationComponent";
import axios from "axios";

class CardsContainer extends Component {
  constructor() {
    super();
    this.state = {};
    axios
      .get("https://itpro2017.herokuapp.com/api/products")
      .then(response => {
        this.setState({ products: response.data });
      })
      .catch(error => {
        console.log(error);
      });
  }
  render() {
    var products = this.state.products.map(item => {
      return (
        <Card
          id={item.id}
          image={item.title}
          title={item.title}
          description={item.description}
          price={item.price}
          quantity={item.title}
        />
      );
    });
    return (
      <Card
        image="https://images.unsplash.com/photo-1518302057166-c990a3585cc3?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1267&q=80"
        title="Test Product"
        description="This is my test description for my test product."
        price="123"
        quantity="48"
      />
    );
  }
}

export default CardsContainer;
